import React, { useState, useEffect } from 'react';
import { createCommerce } from '../services/commerceService';

const CommerceForm = () => {
  const [formData, setFormData] = useState({
    RUC: '',
    NombreComercial: '',
    RazonSocial: '',
    Direccion: '',
    Telefono: '',
    NombreContacto: '',
    TipoEstablecimiento: 'Restaurante',
    ImagenLogotipo: null
  });

  const [validated, setValidated] = useState(false);

  const handleChange = (e) => {
    const { name, value, files } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: files ? files[0] : value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (e.currentTarget.checkValidity() === false) {
      e.stopPropagation();
    } else {
      try {
        const formDataToSend = new FormData();
        for (const key in formData) {
          formDataToSend.append(key, formData[key]);
        }
        await createCommerce(formDataToSend);
        alert('Commerce created successfully!');
      } catch (error) {
        console.error('Error creating commerce:', error);
        alert('Failed to create commerce');
      }
    }
    setValidated(true);
  };

  return (
    <div className="container mt-5">
      <h2 className="text-center mb-4">Registro de Comercio</h2>
      <form onSubmit={handleSubmit} className="p-4 border rounded shadow-sm bg-light">
        <div className="mb-3">
          <label htmlFor="RUC" className="form-label">RUC</label>
          <input
            type="text"
            className="form-control"
            id="RUC"
            name="RUC"
            value={formData.RUC}
            onChange={handleChange}
            placeholder="Ingrese el RUC"
            required
          />
        </div>
        <div className="mb-3">
          <label htmlFor="NombreComercial" className="form-label">Nombre Comercial</label>
          <input
            type="text"
            className="form-control"
            id="NombreComercial"
            name="NombreComercial"
            value={formData.NombreComercial}
            onChange={handleChange}
            placeholder="Ingrese el Nombre Comercial"
            required
          />
        </div>
        <div className="mb-3">
          <label htmlFor="RazonSocial" className="form-label">Razón Social</label>
          <input
            type="text"
            className="form-control"
            id="RazonSocial"
            name="RazonSocial"
            value={formData.RazonSocial}
            onChange={handleChange}
            placeholder="Ingrese la Razón Social"
            required
          />
        </div>
        <div className="mb-3">
          <label htmlFor="Direccion" className="form-label">Dirección</label>
          <input
            type="text"
            className="form-control"
            id="Direccion"
            name="Direccion"
            value={formData.Direccion}
            onChange={handleChange}
            placeholder="Ingrese la Dirección"
            required
          />
        </div>
        <div className="mb-3">
          <label htmlFor="Telefono" className="form-label">Teléfono</label>
          <input
            type="text"
            className="form-control"
            id="Telefono"
            name="Telefono"
            value={formData.Telefono}
            onChange={handleChange}
            placeholder="Ingrese el Teléfono"
            required
          />
        </div>
        <div className="mb-3">
          <label htmlFor="NombreContacto" className="form-label">Nombre de Contacto</label>
          <input
            type="text"
            className="form-control"
            id="NombreContacto"
            name="NombreContacto"
            value={formData.NombreContacto}
            onChange={handleChange}
            placeholder="Ingrese el Nombre de Contacto"
            required
          />
        </div>
        <div className="mb-3">
          <label htmlFor="TipoEstablecimiento" className="form-label">Tipo de Establecimiento</label>
          <select
            className="form-select"
            id="TipoEstablecimiento"
            name="TipoEstablecimiento"
            value={formData.TipoEstablecimiento}
            onChange={handleChange}
          >
            <option value="Restaurante">Restaurante</option>
            <option value="Transporte">Transporte</option>
            <option value="Hotel">Hotel</option>
          </select>
        </div>
        <div className="mb-3">
          <label htmlFor="ImagenLogotipo" className="form-label">Imagen Logotipo</label>
          <input
            type="file"
            className="form-control"
            id="ImagenLogotipo"
            name="ImagenLogotipo"
            onChange={handleChange}
          />
        </div>
        <button type="submit" className="btn btn-primary w-100">Crear Comercio</button>
      </form>
    </div>
  );
};

export default CommerceForm;
